  Routes,
  Route,
  Redirect
} from 'react-router-dom';

import TextEditor from './TextEditor';

function App() {
  return (
    <div>
      <Router>
        <Routes>
          <Route path="/" exact>

          </Route>
          <Route path="/document/:id">

          </Route>
        </Routes>
      </Router>
      <TextEditor />
    </div>
  );
}

export default App;
